const AboutMe = () => {
    return (
      <section className="about-me">
        <div className="about-me__container">
          <h2 className="about-me__heading">About Me</h2>
          <p className="about-me__description">
            Hi, I'm Ade a Front End Developer based in London. I'm passionate about Web Devlopment and have 1 years of experience in Web Development. 
          </p>
        </div>
      </section>
    );
  }

  export default AboutMe;
